fun Eating (p:PH) : Node list
= PredAllNodes (fn n =>
  cf(p,Mark.System'Eat 1 n) > 0);

fun MaxTIEnabled () : int
= SearchAllNodes(
	  fn _ => true,
	  fn n => length(remdupl(map ArcToTI(OutArcs n))),
	  0,
	  Int.max);

